import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import UserList from './components/UserList';
import NewUser from './components/NewUser';
import UserDetail from './components/UserDetail';
import P5History from './components/P5History';
import RewardHistory from './components/RewardHistory';
import NewReward from './components/NewReward';

const App = () => (
  <Router> {/* Ensure there is only one Router component */}
    <Route>
      <Route path="/" exact component={UserList} />
      <Route path="/new" component={NewUser} />
      <Route path="/:id" exact component={UserDetail} />
      <Route path="/:id/p5" component={P5History} />
      <Route path="/:id/rewards" component={RewardHistory} />
      <Route path="/:id/rewards/new" component={NewReward} />
    </Route>
  </Router>
);

export default App;
